	}

	componentWillUnmount() { 
	   window.removeEventListener('load', this.handleLoad)  
	}

	handleLoad() {
		console.log("YEAH!");
	 }

	render (){
		return (
			<div className="Home">
				<Navbar />
				<ProfileHeader />
				<MyResumeContent />
			</div>
		);
	}
}

export default MyResume;
